import React from "react";

const Info = () => {
  return (
    <div className="about_info grid">
      <div className="about_box">
        <i className="uil uil-graduation-cap about_icon"></i>
        <h3 className="about_title">Degree</h3>
        <span className="about_subtitle">Bachelor of Science</span>
      </div>

      <div className="about_box">
        <i className="uil uil-graduation-cap about_icon"></i>
        <h3 className="about_title">Degree</h3>
        <span className="about_subtitle">Bachelor of Science</span>
      </div>

      <div className="about_box">
        <i className="uil uil-graduation-cap about_icon"></i>
        <h3 className="about_title">Degree</h3>
        <span className="about_subtitle">Bachelor of Science</span>
      </div>
    </div>
  );
};

export default Info;
